import React from "react";

function Header(props) {
  return (
    <div className="container bg-primary">
      <div className="row " style={{ height: "10vh" }}>
        <h5 className="mt-3 Nav" style={{ textAlign: "center" }}>
          {props.name}
        </h5>
      </div>
    </div>
  );
}

export default Header;
